import React from 'react'
import { useNavigate } from 'react-router-dom';
const Create = () => {
    const navigate=useNavigate();
    const handle=(e)=>{
        e.preventDefault();
        navigate('/');
    }
  return (
    <div className='create'> <h1>Create your own blog</h1>
    <form onSubmit={handle}>
    <input type="text" placeholder='title' name="" id="" />
    <input type="text" placeholder='Describe your blog' name="" id="" />
    <input type="text" placeholder='Tag your blog' name="" id="" />
    <input type="file" placeholder='Choose an image' name="" id="" />
    <button type='submit'></button>
    </form>
    </div>

  )
}

export default Create
